import { Typography } from '@mui/material';
import React from 'react';
import '../style/about.css';

function About() {
  return (
    <section id="about">
      <div className='about_section'>
        <Typography variant="h1">
          ABOUT US
        </Typography>

      </div>
    </section>
  )
}

export default About
